import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import AgregarViaje from './AgregarViaje';
import AgregarComentario from './AgregarComentario';
import ConsultarViajes from './ConsultarViajes';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Inicio</Link>
            </li>
            <li>
              <Link to="/agregar-viaje">Agregar Viaje</Link>
            </li>
            <li>
              <Link to="/agregar-comentario">Agregar Comentario</Link>
            </li>
            <li>
              <Link to="/consultar-viajes">Consultar Viajes</Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<h1>Bienvenido a la App de Gesti√≥n de Viajes</h1>} />
          <Route path="/agregar-viaje" element={<AgregarViaje />} />
          <Route path="/agregar-comentario" element={<AgregarComentario />} />
          <Route path="/consultar-viajes" element={<ConsultarViajes />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
